import React, { Component } from 'react';
import './BottomNav.scss';

class BottomNav extends Component {
  render() {
    return(
      <div className="bottom-nav-container">
        <div>
          <h2 className="signed-title"> Built with hate by a fucking <span className="bottom-nav-highlight">prodigy</span></h2>
        </div>
        <></>
        <img className="bottom-nav-game-img" src="https://assets1.ignimgs.com/2018/09/18/untitled-1-1537271499930_1280w.jpg" alt="game" />
      </div>
    );
  }
}

export default BottomNav;
